import React from 'react'
import Home from './component/Home'
import Header from './component/Header/Header'
import About from './component/about/About'
import Project from './component/projects/Projects'
import Contact from './component/contact/Contact'

import {CssBaseline, Paper} from '@material-ui/core'

import {ThemeProvider, createMuiTheme, makeStyles} from '@material-ui/core/styles'
import {GlobalContext} from './ContextApi'

const useStyles = (themes) => makeStyles(theme => ({
  root: {
    background: theme.palette.type === "light" ? theme.palette.userBackground.light : theme.palette.userBackground.light

  }
}))


function App() {
    const {darkMode} = GlobalContext()
    const theme = createMuiTheme ({
    palette: {
      type: darkMode ? "dark": "light",

      userBackground: {
        light: '#e8eaf6',
        dark: '#424242'
      }

    }
  })
  const classes = useStyles(theme)
  return (
    <ThemeProvider theme={theme}>
      <Paper className={classes.root}>
        <Home />
        <Header />
        <About />
        <Project />
        <Contact />
        </Paper>
    </ThemeProvider>

  )
}

export default App
